export default class Addstudent extends Component {
state={
  data:[]
}


  getGroupName=()=>{
    getGroup().then(res=>{
this.setState({data:res.data})
    })
  }

getId=(id)=>{}


  componentDidMount(){
    this.getGroupName()
  }
  render() {
    return (
<div>
<Form.Select aria-label="Default select example">
 {this.state.data.map(item=>{ return <option value="1">{item.course.title} {item.id}</option>})}
</Form.Select>



</div>
        )
  }
}
